const Cockpit2 = props => {
  //can do anything that componentDidUpdate can do
  //can send http request here
  useEffect(() => {
    console.log('I am inside of [Cockpit.js] useffect');

    //getting rid of timer
    const timer = setTimeout(() => {
      alert('Cockpit timer alert');
    }, 1000);

    return () => {
      //clearTimeout(timer);
      console.log('[Cockpit.js] cleanup work in useEffect');
    };
  }, []);

  //{classes.Cockpit}
  // {cockpitBootstrap}
  return (
    <React.Fragment>
      <button
        className="btn btn-primary"
        type="button"
        onClick={props.deleteCockpit}
      >
        Delete Cockpit
      </button>
    </React.Fragment>
  );
};
//export default Cockpit;

export default React.memo(Cockpit2);
